import React from "react";

const TimeSlot = ({ key, id, time, isPossible, setMeetingDateList }) => {
  return (
    <>
      {isPossible ? <possibleSlot>{time}</possibleSlot> : <impossibleSlot>{time}</impossibleSlot>}
    </>
  );
};

export default TimeSlot;
